  const item = $input.item

  // Check if binary data exists
  if (!item.binary) {
    return item;
  }

  // Get all binary property names (usually 'data', but could be different)
  const binaryPropertyNames = Object.keys(item.binary);

  // Process each binary property
  for (const binaryPropertyName of binaryPropertyNames) {
    const binaryData = item.binary[binaryPropertyName];

    // Get the file extension from fileName
    let fileExtension = '';
    if (binaryData.fileName) {
      const fileNameParts = binaryData.fileName.split('.');
      if (fileNameParts.length > 1) {
        fileExtension = fileNameParts[fileNameParts.length - 1].toLowerCase();
      }
    }

    // Check if it's a PDF and update MIME type
    if (fileExtension === 'pdf') {
      binaryData.mimeType = 'application/pdf';
      binaryData.fileExtension = 'pdf';
      console.log(`Updated MIME type for ${binaryData.fileName} to application/pdf`);
    }
    // Optional: Add other file types as needed
    else if (fileExtension === 'jpg' || fileExtension === 'jpeg') {
      binaryData.mimeType = 'image/jpeg';
    }
    else if (fileExtension === 'png') {
      binaryData.mimeType = 'image/png';
    }
    else if (fileExtension === 'txt') {
      binaryData.mimeType = 'text/plain';
    }
  }

return item;

